css:
.sheet-toolbar {
  border-bottom: none;
  box-shadow: 0 0 0.5px #313236, 0 1px 1.5px #313236, 0 0 3px #313236;
}
.thread-icon:not(.thread-icon-unread):not(.thread-icon-star) {
  -webkit-filter: invert(100%);
}
img.content-dark {
  -webkit-filter: invert(100%);
}
img.content-light {
  -webkit-filter: invert(100%);
}
.popover {
  border: 1px solid #313236;
}
.mail-label {
  -webkit-filter: contrast(110%) brightness(85%);
}
.send-later .menu {
  width: 250px;
}
.send-later .menu .item .time {
  display: none;
  float: right;
  padding-right: 12px;
}
.send-later .menu .item.selected .time,
.send-later .menu .item:hover .time {
  display: inline-block;
}
.send-later .divider {
  border-top: 1px solid #313236;
}
.send-later .custom-section {
  padding: 7.5px 12px;
}
.send-later .cancel-section {
  padding: 5px 12px;
  padding-bottom: 6px;
}
.send-later .cancel-section .btn {
  width: 100%;
}
.btn-send-later .at {
  margin-left: 3px;
}
.send-later-status {
  display: flex;
  align-items: center;
}
.send-later-status .time {
  font-size: 0.9em;
  opacity: 0.62;
  color: #5e6a77;
  font-weight: 400;
}
.send-later-status img {
  width: 38px;
  margin-left: 15px;
}
